import { Store } from '@tauri-apps/plugin-store'

export const useMyUserInfoStore = defineStore(
  'user',
  () => {
    const userName = useState(() => '')
    const userAvatar = useState<string>(() => '')
    const apiKey = useState(() => '')
    const theme = useState<'light' | 'dark' | 'system'>('system')

    const loadUserSettings = async () => {
      const store = await Store.load('settings.json')
      theme.value = (await store.get('theme')) ?? 'system'
      apiKey.value = (await store.get('api_key')) ?? ''
      userName.value = (await store.get('username')) ?? 'Sensei'
      userAvatar.value =
        (await store.get('avatar')) ??
        'data:image/png;base64,'
    }

    const setUserName = (name: string) => {
      userName.value = name
    }

    const setUserAvatar = async (avatar: string) => {
      // Don't convert file:// URLs to disk paths in browser
      userAvatar.value = avatar
    }

    return {
      userName,
      userAvatar,
      apiKey,
      theme,
      setUserName,
      setUserAvatar,
      loadUserSettings,
    }
  },
  {
    persist: true,
  }
)
